import React from 'react'
import {Container} from 'react-bootstrap'

const LoggedInProfile = ({firstName, lastName, email}) => {
    return (
        <div>
            <Container>

                Welcome, {firstName} {lastName}!
            </Container>
        </div>
    )
}


export default LoggedInProfile
